import React from "react";
import ReactRoundedImage from "react-rounded-image";
import MyPhoto from "./ProfilePic.jpeg";
//
import RotundaPhoto from "./Rotunda.jpeg"
import styled from "styled-components";
import { Link } from "react-router-dom";


const textStyle = {
	color: "#C5C6C7",
	fontFamily: "Georgia",
};

const Header = styled.h1`
	font-family: Georgia;
	color: #66fcf1;
	padding-left: 100px;
`;

const Seperator = styled.hr`
	border-top: 2px solid #c5c6c7;
	border-radius: 5px;
	width: 50%;
`;

const imageLinkStyle = {
	paddingLeft: "500px",
	paddingTop: "500px",
};

function ProfilePicture() {
	return (
		<div
			style={{
				paddingLeft: "100px",
				paddingTop: "30px",
				paddingBottom: "30px",
			}}
		>
			<ReactRoundedImage
				image={MyPhoto}
				roundedSize='0'
				imageWidth='200'
				imageHeight='200'
			/>
			<h5
				style={{
					paddingTop: "30px",
					color: "#66FCF1",
				}}
			>
				Borja Ingle-Fernandez
			</h5>
			<a
				style={{
					// paddingTop: "100px",
					paddingLeft: "10px",
					color: "#C5C6C7",
				}}
				href='mailto: borja.ingle@gmail.com'
			>
				borja.ingle@gmail.com
			</a>
		</div>
	);
}

function NameDescription() {
	return (
		<div
			style={{
				paddingLeft: "100px",
				paddingRight: "100px",
				paddingTop: "20px",
			}}
		>
			<p style={textStyle}>
				{" "}
				Lorem Ipsum is simply dummy text of the printing and typesetting
				industry. Lorem Ipsum has been the industry's standard dummy text ever
				since the 1500s, when an unknown printer took a galley of type and
				scrambled it to make a type specimen book. It has survived not only five
				centuries, but also the leap into electronic typesetting, remaining
				essentially unchanged. It was popularised in the 1960s with the release
				of Letraset sheets containing Lorem Ipsum passages, and more recently
				with desktop publishing software like Aldus PageMaker including versions
				of Lorem Ipsum.
			</p>
		</div>
	);
}

function HomePage() {
	return (
		<div
			style={{
				paddingTop: "20px",
				backgroundColor: "#202020",
			}}
		>
			<div
				className='Introduction'
				style={{
					display: "flex",
					justifyContent: "center",
					width: "80%",
					margin: "auto",
				}}
			>
				<ProfilePicture />
				<div
					style={{
						paddingTop: "50px",
					}}
				>
					<Header>About My Website</Header>
					<NameDescription />
				</div>
			</div>
			<Seperator></Seperator>
			<div
				style={{
					display: "flex",
					justifyContent: "center",
					width: "80%",
					margin: "auto",
					paddingTop: "20px",
				}}
			>
				<div>
					<Link to='/about'>
						<img src={RotundaPhoto}></img>
					</Link>
					<Link to='/education'>
						<img src={RotundaPhoto}></img>
					</Link>
				</div>
				<div
				style={{paddingTop: "30px"}}>
					<Link to='/experience'>
						<img src={RotundaPhoto}></img>
					</Link>
					<Link to='/contact'>
						<img src={RotundaPhoto}></img>
					</Link>
				</div>
			</div>
		</div>
	);
}

export default HomePage;
